/**
 * App
 * @param {} uiobj :ui.swKuaiShou
 * @param {} url
 * @param {} appPackages
 */
function switchEvent(uiobj, url, appPackages) {
    let is;
    uiobj.on("check", function (checked) {
        if (checked) {
            // let filePath = files.getSdcardPath() + "/test.apk";
            is = appIsInstalled(appPackages);
            if (!is) {
                confirm(",?").then(value => {
                    //, valuetruefalse, """"
                    // log("is:" + value);
                    if (value) {
                        // downloadApp(filePath, url);
                        app.openUrl(url);
                        uiobj.checked = true;
                    } else {
                        uiobj.checked = false;
                    }
                });
            }
        }
    })
}

